s su kitais','Customer information like your name, email address, and billing and shipping information.'=>'Pirkėjo informacija, tokia kaip vardas, el. paštas, registracijos ir pristatymo adresai.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Ši informacija prieinama mūsų komandos nariams, kad jie galėtų vykdyti užsakymus, atlikti grąžinimus ir teikti Jums bet kokią reikiamą pagalbą.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Užsakymo informacija - kas ir kada buvo pirkta bei kur turi būti pristatyta, ir','Who on our team has access'=>'Mūsų komandos prieiga','We will also store comments or reviews, if you choose to leave them.'=>'Mes taip pat išsaugome komentarus ir atsiliepimus, jei juos parašote.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Mūsų komandos nariai gali matyti informaciją, kurią Jūs pateikiate. Pavyzdžiui, tinklalapio administratoriai ir parduotuvės valdytojai gali matyti:','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Mes saugome Jūsų duomenis tol, kol jie mums reikalingi įgyvendinti tiems tikslams, dėl kurių šie duomenys yra renkami ir naudojami, ir tol, kol yra būtina pagal teisinius reikalavimus. Pavyzdžiui, mes saugome užsakymų informaciją XXX metų dėl mokestinių ir apskaitos tikslų. Ši informacija apima Jūsų vardą, pavardę, el. paštą bei registracijos ir pristatymo adresus.','Improve our store offerings'=>'Pagerinti mūsų parduotuvės pasiūlymus','Respond to your requests, including refunds and complaints'=>'Atsakyti į jūsų užklausas, įskaitant grąžinimus ir nusiskundimus','Set up your account for our store'=>'Sukurti Jums paskyrą mūsų parduotuvėje','Process payments and prevent fraud'=>'Priimti mokėjimus ir saugotis nuo apgavysčių','Send you information about your account and order'=>'Siųsti Jums informaciją apie Jūsų paskyrą ir užsakymus','Comply with any legal obligations we have, such as calculating taxes'=>'Atlikti reikiamus teisinius reikalavimus, pavyzdžiui, paskaičiuoti mokesčius.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jei susikursite paskyrą, mes išsaugosime Jūsų vardą, el. paštą ir telefono numerį, kurie bus naudojami užsakymų apmokėjimo informacijai sukurti.','Send you marketing messages, if you choose to receive them'=>'Siųsti Jums reklaminius pranešimus, jei Jūs pasirinkote juos gauti','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kai perkate mūsų parduotuvėje, turite pateikti informaciją, tokią kaip Jūsų vardas ir pavardė, adresas, pristatymo adresas, el. paštas, telefonas, mokėjimui reikalinga informacija ir pasirinktas paskyros vartotojo vardas bei slaptažodis. Šią informaciją mes naudosime tokiems tikslams:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Pastaba: slapukų politiką galite aprašyti išsamiau atskirai, ir čia įdėti nuorodą į ją.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Mes taip pat naudojame slapukus išsaugoti Jūsų krepšelio turiniui.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Pristatymo adresas: prašome jį pateikti, kad galėtume apskaičiuoti ir parodyti Jums pristatymo kainą bei pristatyti Jums užsakymą.','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Jūsų vieta, IP adresas ir naršyklės rūšis: šią informaciją naudojame mokesčių bei pristatymo kainos apskaičiavimui','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produktai, kuriuos Jūs peržiūrėjote: šią informaciją naudojame rodydami Jums produktus, kuriais Jūs domėjotės','What we collect and store'=>'Kokią informaciją renkame ir saugome','While you visit our site, we’ll track:'=>'Kol Jūs lankotės mūsų tinklalapyje, mes išsaugome:','We collect information about you during the checkout process on our store.'=>'Mes renkame informaciją apie Jus apmokėjimo metu.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Šis labai paprastas pavyzdys apima tik pagrindinę informaciją apie asmeninius duomenis kuriuos Jūsų parduotuvė gali rinkti, saugoti ir perduoti; bei kas gali šiuos duomenis matyti. Priklausomai nuo nustatymų bei kitų naudojamų įskiepių, konkretūs saugomi asmens duomenys gali būti skirtingi kiekvienoje parduotuvėje. Sudarant savo parduotuvės privatumo politiką rekomenduojame konsultuotis su teisininkais.','User email'=>'Vartotojo elektroninis paštas','Items Purchased'=>'Įsigytos prekės','Access granted'=>'Leidimas duotas','Order Number'=>'Užsakymo numeris','Download count'=>'Atsisiuntimų skaičius','Browser User Agent'=>'Naršyklės vartotojo agentas','Personal data removed.'=>'Asmeniniai duomenys ištrinti.','Display name'=>'Rodomas vardas','Phone Number'=>'Tele