amus krepšelius ir krepšelius išsaugotus duomenų bazėje.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Šis įrankis ištrins visas pasibaigusio galiojimo prieigas prie parsisiuntimų ir prieigas su 0 likusių parsisiuntimų.','Clean up download permissions'=>'Išvalyti parsisiuntimų prieigas','Used-up download permissions'=>'Išnaudotos parsisiuntimų prieigos','Name of the customer for the order'=>'Pirkėjas vardas užsakymui','URL to edit the order'=>'URL užsakymo redagavimui','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Jūsų parduotuvė nenaudoja saugaus duomenų perdavimo protokolo. Mes rekomenduojame visoje parduotuvėje naudoti HTTPS protokolą ir taip apsaugoti Jūsų pirkėjų duomenis. <a href="%s">Daugiau informacijos.</a>','Cloning is forbidden.'=>'Klonavimas uždraustas.','Update status event failed.'=>'Statuso atnaujinti nepavyko.','Error during status transition.'=>'Klaida keičiant statusą.','If the payment was refunded via the API.'=>'Jei mokėjimas buvo grąžintas per API.','Billing City'=>'Pirkėjo miestas','Billing Company'=>'Pirkėjo įmonė','Billing First Name'=>'Pirkėjo vardas','Billing Last Name'=>'Pirkėjo pavardė','Billing Postal/Zip Code'=>'Pirkėjo pašto kodas','Billing State'=>'Pirkėjo valstija','optional'=>'nebūtinas','Display name cannot be changed to email address due to privacy concern.'=>'Pasirinktas vardas negali būti pakeistas į el. paštą dėl privatumo nustatymų.','WooCommerce pages'=>'WooCommerce puslapiai','WooCommerce database version'=>'WooCommerce duomenų bazės versija','Enable coupons'=>'Įjungti kuponus','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Yra naujesnė WordPress versija (%2$s)','Account endpoints'=>'Paskyros kreipimosi taškai','Enable tax rates and calculations'=>'Įjungti mokesčių tarifus ir skaičiavimus'