n forms.'=>'Galite įrašyti tekstą apie Jūsų parduotuvėje taikomą privatumo politiką - jis bus rodomas paskyros registracijos formoje.','Removed personal data from %s order.'=>'Ištrinti asmeninius duomenis iš %s užsakymo.' . "\0" . 'Ištrinti asmeninius duomenis iš %s užsakymų.' . "\0" . 'Ištrinti asmeninius duomenis iš %s užsakymų.','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Privatumo politikos nustatymai. Žemiau matomos žinutės nebus rodomos kol nenustatytas %s puslapis.','Mailchimp'=>'MailChimp','Mailchimp for WooCommerce'=>'MailChimp įskiepis skirtas WooCommerce','Visit Dashboard'=>'Eiti į skydelį','You can also:'=>'Taip pat galite:','You\'re ready to add products to your store.'=>'Jūs jau galite pridėti savo pirmą produktą.','Create some products'=>'Sukurkite produktus','Continue with WooCommerce Services'=>'Prisijungti prie WooCommerce Services','Connect your store to activate WooCommerce Services'=>'Prisijunkite savo parduotuvę prie WooCommerce Services','automated taxes icon'=>'Automatiškai apskaičiuojamų mokesčių simbolis','Storefront icon'=>'Storefront simbolis','View &amp; Customize'=>'Peržiūrėti ir keisti','Review Settings'=>'Peržiūrėti nustatymus','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Dėkojame, kad naudojate Jetpack! Jūsų parduotuvė beveik paruošta: norėdami įjungti kitas paslaugas, pavyzdžiui %s, turite pabaigti prijungimą.','Mailchimp icon'=>'Mailchimp piktograma','Join the 16 million customers who use Mailchimp. Sync list and store data to send automated emails, and targeted campaigns.'=>'Prisijunkite prie 16 milijonų Mailchimp klientų. Sinchronizuokite savo sąrašus ir parduotuvės duomenis, siųskite automatinius el.laiškus ir kampanijas su atrinktais gavėjais.','Save time and errors with automated tax calculation and collection at checkout. Powered by WooCommerce Services and Jetpack.'=>'Su