jams, kai gaunamas naujas užsakymas.','Accept for virtual orders'=>'Naudoti virtualiems užsakymams','Accept COD if the order is virtual'=>'Naudoti apmokėjimą grynais kai užsakymas yra virtualus','Gateway disabled'=>'Mokėjimų tarpininkas išjungtas','Payment for order %s reversed'=>'Apmokėjimas už užsakymą #%s atmestas','Order #%1$s has been marked as refunded - PayPal reason code: %2$s'=>'Užsakymas #%s pažymėtas kaip grąžintas - PayPal klaidos kodas: %s','Order #%1$s has been marked on-hold due to a reversal - PayPal reason code: %2$s'=>'Užsakymas #%s pažymėtas kaip sustabdytas dėl atmesto mokėjimo - PayPal klaidos kodas: %s','Reversal cancelled for order #%s'=>'Apmokėjimo atmetimas užsakymui #%s atšauktas','Order #%1$s has had a reversal cancelled. Please check the status of payment and update the order status accordingly here: %2$s'=>'Užsakymui #%s apmokėjimo atmetimas atšauktas. Prašome pasitikrinkite, ar gavote apmokėjimą ir atitinkamai pakeiskite šio užsakymo statusą čia: %s','PayPal identity token'=>'PayPal identifikacijos raktas','Calculation type'=>'Apskaičiavimo metodas','Per order: Charge shipping for the most expensive shipping class'=>'Kiekvienam užsakymui: pristatymo kaina skaičiuojama brangiausiai pristatymo klasei','Per class: Charge shipping for each shipping class individually'=>'Kiekvienai klasei: pristatymo kaina skaičiuojama kiekvienai pristatymo klasei atskirai','Enable check payments'=>'Įjungti apmokėjimą čekiais','Account details'=>'Vartotojo informacija','What ZIP/post codes are available for local delivery?'=>'Kokiems pašto kodams galimas atsiėmimas vietoje?','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Pridėtiniai tarifai yra papildomos pristatymo sąlygos, kurios sąlygoja papildomus kaštus (lyginant su fiksuotu tarifu).','"%s" shipping class cost'=>'"%s" pristatymo klasės kaina','Shipping class costs'=>'Pristatymo klasės kaina','Enter your PayPal API credentials to process refunds via PayPal. Learn how to access your <a href="%s">PayPal API Credentials</a>.'=>'Įveskite savo PayPal API duomenis, kad galėtumėte atlikti grąžinimus per PayPal. Kaip sužinoti šiuos duomenis, paaiškinta <a href="%s">čia</a>.','Make your payment directly into our bank account. Please use your Order ID as the payment reference. Your order will not be shipped until the funds have cleared in our account.'=>'Apmokėkite padarydami pavedimą į mūsų banko sąskaitą. Prašome įrašyti Jūsų užsakymo numerį kaip mokėjimo paskirtį. Užsakymas nebus išsiųstas kol pavedimas nepasieks mūsų banko sąskaitos.','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Galite įjungti "Payment Data Transfer" savo PayPal paskyroje (Profile > Profile and Settings > My Selling Tools > Website Preferences) ir čia įdėti ten gautą idetifikacijos raktą. Įrašius raktą, galėsite gauti patvirtinimus apie mokėjimus nenaudojant PayPal IPN paslaugos.','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'Palaiko tokius pakeitėjus: <code>[qty]</code> = prekių kiekis, <code>[cost]</code> = prekių kaina, <code>[fee percent="10" min_fee="20"]</code> = priemoka procentine išraiška.','Enter a cost (excl. tax) or sum, e.g. <code>10.00 * [qty]</code>.'=>'Įveskite kainą (be mokesčių) ar sumą, pvz. <code>10.00 * [kiekis]</code>.','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Šie kaštai gali papildomai būti pridėti pagal <a href="%s">produkto pristatymo klasę</a>.','No shipping class cost'=>'Nėra pristatymo klasės kaštų','[Order #%s]'=>'[Užsakymas #%s]','Your {site_title} order #{order_number} has been partially refunded'=>'{site_title}: Jūsų užsakymas #{order_number} yra dalinai gr