 can use at one time.'=>'Maksimalus atminties kiekis (RAM) kurį Jūsų tinklalapis gali naudoti.','Language'=>'Kalba','The current language used by WordPress. Default = English'=>'Šiuo metu WordPress nustatyta kalba. Numatytoji - anglų.','Server environment'=>'Serverio savybės','Server info.'=>'Serverio informacija','Information about the web server that is currently hosting your site.'=>'Informacija apie serverį, kuriame laikomas šis tinklalapis.','PHP version.'=>'PHP versija','The version of PHP installed on your hosting server.'=>'Jūsų serverio PHP versija.','PHP post max size'=>'PHP įrašo maksimalus dydis','The largest filesize that can be contained in one post.'=>'Didžiausias vieno įrašo dydis.','PHP time limit'=>'PHP laiko limitas','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Laiko tarpas (sekundėmis) kurį Jūsų tinklalapis užtrunka atlikdamas vieną veiksmą prieš nutraukdamas jį dėl per ilgos trukmės (norint išvengti išjungimo serveryje)','PHP max input vars'=>'PHP maksimalus įvedamų simbolių kiekis','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Didžiausias skaičius kintamųjų, kurį Jūsų serveris gali apdoroti per vieną funkciją neužstrigdamas.','SUHOSIN installed'=>'SUHOSIN instaliuotas','MySQL version.'=>'MySQL versija','The version of MySQL installed on your hosting server.'=>'Jūsų serverio MySQL versija','Max upload size.'=>'Maksimalus įkėlimo dydis','The largest filesize that can be uploaded to your WordPress installation.'=>'Didžiausias failas kuris gali būti įkeltas į Jūsų WordPress.','Default timezone is UTC'=>'Numatytoji laiko zona yra UTC','The default timezone for your server.'=>'Jūsų serverio numatytoji laiko zona.','Default timezone is %s - it should be UTC'=>'Numatytoji laiko zona yra %s - tai turėtų būti UTC','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Mokėjimų tarpininkai gali naudoti cURL nuotoliniam ryšiui su serveriais kai autorizuojami mokėjimai, taip pat cURL gali naudoti ir kai kurie įskiepiai.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Jūsų serveryje neįjungtas nei fsockopen, nei cURL - PayPal IPN ir kiti skriptai, kurie bendrauja su kitais serveriais, neveiks. Kreipkitės į savo tinklalapio hostingo tiekėją.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Kai kurie interneto paslaugų tiekėjai, pavyzdžiui, pristatymo sekimo sistemos, naudoja SOAP informacijos gavimui iš nutolusių serverių.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'HTML/Daugiapusių el.laiškų CSS šablonuose generuojamas naudojant DOMDocument.','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'GZip (gzopen) naudojamas GEOIP duomenų bazės iš MaxMind atidarymui.','Remote post'=>'Nuotolinis įrašas','PayPal uses this method of communicating when sending back transaction information.'=>'Šį metodą naudoja PayPal, juo atsiunčiama transakcijų informacija.','Error: %s'=>'Klaida: %s','Remote get'=>'Nuotolinė GET funkcija','WooCommerce plugins may use this method of communication when checking for plugin updates.'=>'Kai kurie WooCommerce įskiepiai naudoja šį metodą tikrinant ar nėra atnaujinimų.','WC database version.'=>'WC duomenų bazės versija','Active plugins.'=>'Aktyvūs įskiepiai','Visit plugin homepage'=>'Aplankyti įskiepio tinklalapį','Network enabled'=>'Tinklas įjungtas','Force SSL'=>'Naudoti SSL','Does your site force a SSL Certificate for transactions?'=>'Ar atliekant transakcijas naudojamas SSL sertifikatas?','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Koks piniginis vienetas naudojamas kainoms ir kurie mokėjimų tarpininkai įjungti.','The position of the currency symbol.'=>'Piniginio vieneto simbolio vieta','The thousand separator of displayed prices.'=>'Rodomų kainų tūkstančių skirtukas','The decimal separator of displayed prices.'=>'Rodomų kainų dešimtųjų skirtukas','The number of decimal points shown in displayed prices.'=>'Kiek dešimtųjų tikslumu rodomos kainos','Page not set'=>'Puslapis nenustatytas','Page does not contain the %s shortcode.'=>'Puslapyje nėra shortcode\'o: %s','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'Užsakymo/produkto statusuose naudojamų taksonomijų terminų sąrašas.','Theme'=>'Tema','The name of the current active theme.'=>'Šiuo metu aktyvios temos pavadinimas','Version'=>'Versija','The installed version of the current active theme.'=>'Šiuo metu aktyvios temos versija.','%s is available'=>'%s naujausia','Author URL'=>'Autoriaus URL','The theme developers URL.'=>'Temos kūrėjo URL','Child theme'=>'Potemė','Displays whether or not the current theme is a child theme.'=>'Rodoma, ar šiuo metu įjungta tema yra potemė.','Parent theme name.'=>'Tėvinės temos pavadinimas','The name of the parent theme.'=>'Tėvinės temos pavadinimas','Parent theme version.'=>'Tėvinės temos versija','The installed version of the parent theme.'=>'Naudojama tėvinės temos versija','Parent theme author URL.'=>'Tėvinės temos autoriaus URL','The parent theme developers URL.'=>'Tėvinės temos kūrėjų URL','WooCommerce support'=>'WooCommerce palaikymas','Displays whether or not the current active theme declares WooCommerce support.'=>'Rodoma, ar esama aktyvi tema turi WooCommerce palaikymą.','Not declared'=>'Neturi','Templates'=>'Šablonai','This section shows any files that are overriding the default WooCommerce template pages.'=>'Čia rodomi failai, kuriais perrašomi numatytieji WooCommerce šablonai.','Overrides'=>'Šablonus perrašantys failai','Tools'=>'Įrankiai','Logs'=>'Log\'ai','— No Change —'=>'— Nekeisti —','Change to:'=>'Keisti į:','Enter price (%s)'=>'Įveskite kainą (%s)','Save changes'=>'Išsaugoti pakeitimus','Sale'=>'Akcija','Decrease existing price by (fixed amount or %):'=>'Sumažinti įprastą kainą (fiksuotas dydis arba %):','Enter sale price (%s)'=>'Įveskite akcijinę kainą (%s)','L/W/H'=>'Ilgis/plotis/aukštis','Length (%s)'=>'Ilgis (%s)','Width (%s)'=>'Plotis (%s)','Height (%s)'=>'Aukštis (%s)','Visibility'=>'Matomumas','Catalog &amp; search'=>'Katalogas ir paieška','In stock?'=>'Turime?','Backorders?'=>'Leisti išankstinius užsakymus','Sold individually?'=>'Parduodama tik po vieną?','Custom:'=>'Pasirinktinai:','Page settingShop base'=>'Parduotuvės bazė','Page settingCart'=>'Krepšelis','Page settingCheckout'=>'Apmokėjimas','Page settingMy account'=>'Paskyra','Consumer secret is invalid.'=>'Vartotojo slaptasis kodas yra klaidingas','Invalid coupon code'=>'Neteisingas nuolaidos kodas','Missing parameter %s'=>'Trūksta parametro %s','The coupon code already exists'=>'Toks nuolaidos kodas jau egzistuoja','Placeholder'=>'Paskirtoji vieta','Deleted %s'=>'Ištrintas %s','Database'=>'Duomenų bazė','Table does not exist'=>'Lentelė neegzistuoja','API Version'=>'API versija','Run the Setup Wizard'=>'Paleisti nustatymų vedlį','Skip setup'=>'Praleisti pradinius nustatymus','Learn more about templates'=>'Daugiau apie šablonus','Displays whether or not WordPress is in Debug Mode.'=>'Parodoma, ar įjungtas WordPress klaidų rodymo režimas.','Several WooCommerce extensions can write logs which makes debugging problems easier. The directory must be writable for this to happen.'=>'Kai kurie WooCommerce įskiepiai įrašinėja log\'us, todėl klaidų ieškoti lengviau. Tačiau log\'ų direktorija turi turėtų įrašymo leidimus.','<strong>Welcome to WooCommerce</strong> &#8211; You&lsquo;re almost ready to start selling :)'=>'<strong>Dėkojame, kad pasirinkote WooCommerce</strong> &#8211; Jūs beveik pasirengę pradėti pardavinėti.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Jei keičiate WooCommerce veikimą per tėvinę temą, kurios kūrėjas nesate Jūs pats, rekomenduojame naudoti potemes. Daugiau infomacijos: <a href="%s" target="_blank">How to create a child theme</a>','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'Jūsų serveryje neįjungta %s klasė - be DOMDocument neveiks HTML/Įvairaus turinio el.laiškai bei kai kurie įskiepiai.','WooCommerce API. Use a consumer key in the username field and a consumer secret in the password field.'=>'WooCommerce API. Naudokite vartotojo raktą vietoje vartotojo vardo ir vartotojo slaptajį kodą vietoje slaptažodžio.','File does not exist'=>'Failas neegzistuoja','Coupons can be applied from the cart and checkout pages.'=>'Nuolaidų kodus galima įrašyti krepšelio ir apmokėjimo puslapiuose.','Allows customers to checkout without an account.'=>'Leisti pirkėjams apmokėti nekuriant paskyros.','Force secure checkout'=>'Naudoti tik saugų apmokėjimą','Force HTTP when leaving the checkout'=>'Naudoti tik HTTP kai paliekamas apmokėjimo puslapis','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Šie puslapiai turi būti nustatyti, kad WooCommerce žinotų, kur nukreipti pirkėją susimokėti.','Cart page'=>'Krepšelio puslapis','Checkout page'=>'Apmokėjimo puslapis','Terms and conditions'=>'Taisyklių ir sąlygų puslapis','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Jei nurodysite Taisyklių ir sąlygų puslapį, prieš atsiskaitant pirkėjas bus paprašytas su jomis sutikti.','Checkout endpoints'=>'Apmokėjimo kreipimosi taškai','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Kreipimosi taškai yra pridedami prie apmokėjimo puslapio URL, jų pagalba atliekami specifiniai veiksmai reikalingi apmokėjimui. Šie taškai turi būti unikalūs.','Pay'=>'Sumokėti','Endpoint for the "Checkout &rarr; Pay" page.'=>'Kreipimosi taškas puslapiui Apmokėjimas &rarr; Sumokėti','Order received'=>'Užsakymas gautas','Endpoint for the "Checkout &rarr; Order received" page.'=>'Kreipimosi taškas puslapiui Apmokėjimas &rarr; Užsakymas gautas','Add payment method'=>'Pridėti mokėjimo būdą','Endpoint for the "Checkout &rarr; Add payment method" page.'=>'Kreipimosi taškas puslapiui Apmokėjimas &rarr; Pridėti mokėjimo būdą','Emails'=>'El.laiškai','Email sender options'=>'El.laiškų siuntėjo nustatymai','"From" name'=>'„Nuo“ Vardas','Selling location(s)'=>'Pardavimo vieta(-tos)','This option lets you limit which countries you are willing to sell to.'=>'Šis nustatymas leidžia pasirinkti, kuriose šalyse vykdysite veiklą.','Sell to all countries'=>'Pardavinėti visose šalyse','Specific Countries'=>'Tam tikros valstybės','Shop base address'=>'Parduotuvės buveinės adresas','Store notice'=>'Parduotuvės pastaba','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Tai bandomoji parduotuvė, skirta tik testuoti &mdash; užsakymai nebus vykdomi.','Currency options'=>'Piniginio vieneto nustatymai','The following options affect how prices are displayed on the frontend.'=>'Čia nustatoma, kaip pirkėjams matomoje parduotuvės dalyje atvaizduojamos kainos.','Currency'=>'Piniginis vienetas','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Čia nustatomas piniginis vienetas, kuriuo rodomos kainos ir kuris bus pateikiamas apmokėjimo tarpininkams.','This controls the position of the currency symbol.'=>'Čia nustatoma piniginio vieneto simbolio pozicija lyginant su kaina.','This sets the thousand separator of displayed prices.'=>'Nustato, kaip vaizduojant kainas atskiriami tūkstančiai.','This sets the decimal separator of displayed prices.'=>'Nustato, kaip vaizduojant kainas atskiriami centai.','Number of decimals.'=>'Centų ženklų skaičius','This sets the number of decimal points shown in displayed prices.'=>'Nustato, kiek skaičių kainose rodyti po kablelio.','Integration'=>'Integracijos','Shop page'=>'Parduotuvės puslapis','This sets the base page of your shop - this is where your product archive will be.'=>'Tai bazinis parduotuvės puslapis - čia bus jūsų produktų archyvas.','Shop page display'=>'Parduotuvės vaizdas','Show products'=>'Rodyti tik produktus','Show subcategories'=>'Rodyti subkategorijas','Default product sorting'=>'Numat. produktų rikiavimas','Default sorting (custom ordering + name)'=>'Numatytasis (pasirinktas rikiavimas + pavadinimas)','Popularity (sales)'=>'Populiarumas (pagal pardavimus)','Average rating'=>'Vidutinis įvertinimas','Sort by most recent'=>'Naujumas','Sort by price (asc)'=>'Kaina (↑)','Sort by price (desc)'=>'Kaina (↓)','Add to cart behaviour'=>'Krepšelio veiksmai','Redirect to the cart page after successful addition'=>'Perkelti į krepšelio puslapį po sėkmingo produkto pridėjimo','Enable AJAX add to cart buttons on archives'=>'Įjungti AJAX pridėjimo į krepšelį mygtukus archyvuose','Manage stock'=>'Valdyti atsargas','Enable stock management'=>'Įjungti atsargų valdymą','Hold stock (minutes)'=>'Sulaikyti atsargas (min)','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'Sulaikyti atsargas (neapmokėtiems užsakymams) x min. Kai šis limitas bus pasiektas, laukiantis apmokėjimo užsakymas bus atšauktas. Palikite tuščią, jei funkcija nereikalinga.','Notifications'=>'Pranešimai','Enable low stock notifications'=>'Įjungti pranešimus apie besibaigiančius produktus','Enable out of stock notifications'=>'Įjungti pranešimus apie pasibaigusius produktus','Low stock threshold'=>'Besibaigiančių atsargų riba','Out of stock threshold'=>'Pasibaigusių atsargų riba','Out of stock visibility'=>'Pasibaigusių produktų matomumas','Hide out of stock items from the catalog'=>'Nerodyti pasibaigusių produktų','Stock display format'=>'Atsargų rodymo formatas','File download method'=>'Failų atsisiuntimo metodas','Force downloads'=>'Automatinis pasiūlymas atsisiųsti','X-Accel-Redirect/X-Sendfile'=>'X-Accel-Redirect/X-Sendfile','Redirect only'=>'Tik peradresavimas','Access restriction'=>'Prieigos ribojimas','Downloads require login'=>'Norint atsisiųsti, reikia prisijungti','This setting does not apply to guest purchases.'=>'Šis nustatymas netaikomas svečiams.','Grant access to downloadable products after payment'=>'Suteikti prieigą prie atsisiunčiamų produktų po apmokėjimo','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'Įjunkite šį nustatymą, jei norite suteikti prieigą prie atsisiuntimų, kai užsakymai įgauna būseną „vykdomas“, o ne „įvykdytas“.','Measurements'=>'Išmatavimai','Weight unit'=>'Svorio vienetai','This controls what unit you will define weights in.'=>'Čia nustatomi svorio vienetai.','Dimensions unit'=>'Ilgio vienetai','This controls what unit you will define lengths in.'=>'Čia nustatomi ilgio vienetai.','Product ratings'=>'Produktų įvertinimai','Enable the shipping calculator on the cart page'=>'Krepšelio puslapyje įjungti pristatymo skaičiuoklę','Hide shipping costs until an address is entered'=>'Paslėpti pristatymo kainą, kol neįvestas adresas','Shipping destination'=>'Pristatymo vieta','This controls which shipping address is used by default.'=>'Čia nustatoma kuris pirkėjo adresas bus naudojamas.','Ship to all countries you sell to'=>'Pristatymas į visas šalis, kuriose prekiaujate','Ship to all countries'=>'Pristatymas į visas šalis','Ship to specific countries only'=>'Pristatymas tik į pasirinktas šalis','ID'=>'ID','Tax options'=>'Mokesčių nustatymai','Standard rates'=>'Standartiniai tarifai','%s rates'=>'%s tarifai','Generate API key'=>'Generuoti API raktą','Copied!'=>'Nukopijuota!','Country&nbsp;code'=>'Valstybės&nbsp;kodas','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'2 simbolių valstybės kodas, pvz., LT. Tuščia = Visos valstybės.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'2 simbolių valstijos kodas (pvz., AL). Palikite tuščią, jei visoms.','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'Šios taisyklės miestai. Kabliataškiais (;) atskirkite kelias reikšmes. Tuščia = visi miestai.','Rate&nbsp;%'=>'Tarifas&nbsp;%','Enter a tax rate (percentage) to 4 decimal places.'=>'Įveskite procentinį mokesčio tarifą (4 skaičiai po kablelio).','Priority'=>'Pirmenybė','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Mokesčio tarifui parinkite pirmenybę. Bus naudojamas tik vienas atitinkantis tarifas vienai pirmenybei. Norėdami nurodyti kelis tarifus vienam laukeliui , turite kiekvienam tarifui nurodyti skirtingą pirmenybę.','Compound'=>'Sudėtinis','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'Pasirinkite, ar tai su