ated at'=>'Sukurta','Updated at'=>'Atnaujinta','Save webhook'=>'Išsauogti webhook\'ą','Enable taxes'=>'Įjungti mokesčius','Prices entered with tax'=>'Kainos su mokesčiais','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Ši nustatymas yra svarbus, nes paveikia kainų įvedimą. Pakeitimas neatnaujins esamų produktų.','Yes, I will enter prices inclusive of tax'=>'Taip, aš įvesiu kainas su mokesčiais','No, I will enter prices exclusive of tax'=>'Ne, aš įvesiu kainas be mokesčių','Calculate tax based on'=>'Apskaičiuoti mokesčius pagal:','This option determines which address is used to calculate tax.'=>'Čia nustatoma, kuris adresas naudojamas mokesčiams apskaičiuoti.','Customer shipping address'=>'Pirkėjo pristatymo adresas','Customer billing address'=>'Pirkėjo registracijos adresas','Shipping tax class'=>'Pristatymo mokesčio klasė:','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Galite nustatyti, kurią mokesčių klasę gauna pristatymas. Arba palikite tuščią - pristatymo mokestis priklausys nuo krepšelio produktų.','Shipping tax class based on cart items'=>'Pristatymo mokesčio klasė, paremta krepšelio produktais','Rounding'=>'Apvalinimas','Round tax at subtotal level, instead of rounding per line'=>'Suapvalinti bendrą mokesčių sumą, o ne kiekvieną eilutę','Additional tax classes'=>'Papildomos mokesčių klasės','Display prices in the shop'=>'Parduotuvėje rodyti kainas:','Including tax'=>'Su mokesčiais','Excluding tax'=>'Be mokesčių','Display prices during cart and checkout'=>'Krepšelyje ir apmokėjimo metu rodyti kainas:','Price display suffix'=>'Kainos priešdėlis:','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Nurodykite tekstą, kuris bus užrašytas šalia k